import React, {Fragment} from 'react'


const Map_accueil = () => {

        return (
                <Fragment>
                       <div style={{Width:"100%",TextAlign:"center"}}><strong><a href="https://maps.google.com/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=+&amp;q=pulnoy+france&amp;ie=UTF8&amp;hq=&amp;hnear=Pulnoy,+Meurthe-et-Moselle,+Lorraine,+France&amp;t=h&amp;z=14&amp;ll=48.700396,6.256453" style="color:#0000FF;text-align:center;width:400px">View Larger Map</a></strong></div>
                </Fragment>
        )
}

export default Map_accueil
